window.bookSummaryJSON = "<p>From international best-selling author Albany Walker comes a new dark college romance series.</p> <p>She thinks we’re devils. I know we are.</p> <p>Feared and revered, we’ve earned our place to shepard the sheep and harbor their secrets, until she comes along and threatens our foundation.</p> <p>We could ruin or use her. Either way, she’s ours, whether she knows it or not.</p> <p>Nova Devlin:<b> </b>I thought I knew who I was, where I came from, but my life is turned upside down when a stranger knocks on my door with promises that seem too good to be true. I should have run like hell and never looked back, but it’s too late now. I’m enrolled at Cadieux College, where secrets and deception line the walls, and the founding families rule without question. They all think I’ll be easy to use, to control, but I’m nobody’s puppet.</p> <p><i>Made in Malice </i>is the first book in the Corrupt Credence series. A dark college romance with mature content for adult listeners.</p>"; 
